import './NotFound.css';

function NotFound() {
  return (
    <section className="notfound-section">
      <div className="notfound-section-container">
        <h2 className="notfound-title">Kjo faqe nuk ekziston!</h2>
      </div>
    </section>
  )
}

export default NotFound;
